// Define Function

function makeBlobImage (skinModel, imageHTML) {
  fetch(skinModel).then(function(response) {
    return response.blob();
  }).then(function(imageBlob) {
    var blobURL = URL.createObjectURL(imageBlob);
    imageHTML.src = blobURL;
  });  
}

// Run functions

